import {
    FETCH_ALL_PLAYER
} from "../constants/actionTypes.js";

export default (players = [], action) => {
    console.log(action.type);
    switch (action.type) {
        case FETCH_ALL_PLAYER:
            console.log(action.playload);
            return action.playload
        default:
            return players;
    }
};
